import React, { useState, useEffect } from "react";
import "./practicingNoMLS.css";

export default function PracticingNoMLS() {
  useEffect(() => {
    console.log("PracticeRealEstate mounted"); // quick sanity check
    document.title = "Practicing Real Estate | ARAD";
  }, []);

  const [form, setForm] = useState({
    name: "",
    email: "",
    license: "",
    message: "",
  });

  const onChange = (e) =>
    setForm((f) => ({ ...f, [e.target.name]: e.target.value }));

  const onSubmit = (e) => {
    e.preventDefault();
    // TODO: send to your backend / EmailJS / Formspree, etc.
    alert("Thanks! We’ll follow up shortly.");
    setForm({ name: "", email: "", license: "", message: "" });
  };

  return (
    <main
      className="prx"
      style={{ "--prx-hero": 'url("/assets/nonmls/hero.jpg")' }} /* <- add your image */
    >
      {/* HERO */}
      <section className="prx-hero">
        <div className="container">
          <h1>Practice Real Estate under ARAD</h1>
        </div>
      </section>

      {/* BODY */}
      <section className="prx-body">
        <div className="container prx-grid">
          {/* LEFT CONTENT */}
          <article className="prx-content">
            <p>
              ARAD permits the practice of real estate <strong>without</strong> being a
              member of the MLS. Association memberships that control MLS access are
              elective and not required to hold an active real estate license.
            </p>

            <h4>Represent the traditional buyer</h4>
            <p>
              Licensees are supplied with standardized brokerage forms and are encouraged
              to use public research tools such as{" "}
              <a href="https://www.realtor.com" target="_blank" rel="noreferrer">Realtor.com</a>{" "}
              (and similar) for searches and property evaluations.
            </p>

            <h4>Interested?</h4>
            <p>
              You’ll also receive access to additional tools inside the ARAD member
              dashboard. Need help choosing a path (non-MLS practice, referral-only, or
              partner-MLS)? We’ll guide you.
            </p>

            <p className="prx-note">
              Follow-up typically occurs within 1 business day. If you need faster
              assistance, use our <a href="/contact">contact form</a>.
            </p>
          </article>

          {/* RIGHT FORM */}
          <aside className="prx-form">
            <form onSubmit={onSubmit} className="prx-card">
              <label className="prx-field">
                <span>Your name</span>
                <input
                  className="prx-input"
                  name="name"
                  value={form.name}
                  onChange={onChange}
                  placeholder="Your name"
                  required
                />
              </label>

              <label className="prx-field">
                <span>Your email</span>
                <input
                  className="prx-input"
                  type="email"
                  name="email"
                  value={form.email}
                  onChange={onChange}
                  placeholder="you@something.com"
                  required
                />
              </label>

              <label className="prx-field">
                <span>Your Nevada Real Estate license number (optional)</span>
                <input
                  className="prx-input"
                  name="license"
                  value={form.license}
                  onChange={onChange}
                  placeholder="License #"
                />
              </label>

              <label className="prx-field">
                <span>Your message (optional)</span>
                <textarea
                  className="prx-input prx-textarea"
                  name="message"
                  rows="5"
                  value={form.message}
                  onChange={onChange}
                  placeholder="How can we help?"
                />
              </label>

              <button className="prx-btn" type="submit">Submit</button>
            </form>
          </aside>
        </div>
      </section>
    </main>
  );
}
